import { useState, useEffect } from "react"
import { useNavigate } from "react-router-dom"
import { useLocation } from "react-router-dom"
import Doctor from './Doctor'

const SelectDoctorPage = () => {
    const {state} = useLocation()
    const patientId = state.patientId
    const navigate = useNavigate()

    const [doctors, setDoctors] = useState([])
    const [showContinue, setShowContinue] = useState(false)

    const fetchDoctors = async () => {
        const res = await fetch(`http://localhost:8080/doctors`)
        const data = await res.json()

        return data
    }

    useEffect(() => {
        const getDoctors = async () => {
            const doctorsFromLocal = await fetchDoctors()
            console.log(doctorsFromLocal)
            setDoctors(doctorsFromLocal)
        }

        getDoctors()
    }, [])

    const onLogOutSubmit = (e) => {
        e.preventDefault()

        navigate('/', {
        })
    }

    const onContinueSubmit = (e) => {
        e.preventDefault()

        navigate('/patient-page/specialities-page/doctor-page', {
            state: {
                patientId : patientId
            }
        })
    }

    const onBackSubmit = (e) => {
        e.preventDefault()

        navigate('/patient-page/specialities-page', {
            state: {
                patientId : patientId
            }
        })
    }

    return (
        <div>
            <div className = "row">
                <div style={{color: '#0b4a2b', marginLeft : 50, fontSize : 50}}>DocConnect</div>
                <button className = "btn" style = {{marginLeft : 1000}} type="submit" id='btn-log-out' onClick={(e) => onLogOutSubmit(e)}>
                    Log out
                </button>
            </div>
            <div>
                <div className = "container-2">
                    <div className = "container-3">
                        {doctors.map((doctor, index) => (
                            <Doctor key = {index} doctor = {doctor} onClick = {() => (setShowContinue(!showContinue))} />
                        ))}
                    </div>
                    <div className = "row">
                        <button className = "btn" style = {{marginLeft : 200}} type="submit" id='btn-back' onClick={(e) => onBackSubmit(e)}>
                            Back
                        </button>
                        {showContinue && <button className = "btn" style = {{marginLeft : 1100}} type="submit" id='btn-continue' onClick={(e) => onContinueSubmit(e)}>
                            Continue
                        </button>}
                    </div>
                </div>
            </div>
        </div>
    )
};

export default SelectDoctorPage;
